import React from 'react';


const Pic = ({pic}) => {
    return (
        <>
            <p><img alt="picInList" src={pic.url}/></p>
            <p>By: {pic.artist.name} <a href="#" onClick={this.props.savePic}>Save</a></p>
            <p> - </p>
        </>
    )
} 

export default Pic
